trailingComments.value:
*
 *  用于显示NavTitle
 *
 *  支持平台：书旗Android、书旗iOS
 *
 *  @return 0：传入参数解析失败 1：传入参数解析成功
 *
 *  @example
 * libSQ.exec('showAppNavigationTitle', { params: {
 *   message: '标题',
 * } }).then((info) => {
 *    console.log(`[showAppNavigationTitle][then] ${JSON.stringify(info, null, 2)}`);
 *  }).catch((err) => {
 *   alert(`[showAppNavigationTitle][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

